function getUUID() {
    return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
        var r = Math.random() * 16 | 0,
            v = c == 'x' ? r : (r & 0x3 | 0x8);
        return v.toString(16);
    });
}

function validURL(url) {
    var pattern = new RegExp('^(https?:\\/\\/)?' +
        '((([a-z\\d]([a-z\\d-]*[a-z\\d])*)\\.)+[a-z]{2,}|' +
        '((\\d{1,3}\\.){3}\\d{1,3}))' +
        '(\\:\\d+)?(\\/[-a-z\\d%_.~+]*)*' +
        '(\\?[;&a-z\\d%_.~+=-]*)?' +
        '(\\#[-a-z\\d_]*)?$', 'i');
    return !!pattern.test(url);
}

function py(text) {
    return String(pinyin(text, { toneType: 'none' })).replace(/\s*/g, "");
}

const getBookmarks = async () => {
    const bookmarks = await chrome.bookmarks.getTree();

    var result = [];

    function recursion_bookmark(bookmarks) {
        for (var bookmark of bookmarks) {
            if (bookmark.url) {
                result.push(
                    {
                        uuid: getUUID(),
                        type: "bookmark",
                        title: bookmark.title,
                        // title_pinyin: py(bookmark.title),
                        url: bookmark.url,
                        desc: "书签",
                        emoji: true,
                        emojiChar: "⭐️",
                        bookmark_id: bookmark.id,
                        tags: ""
                    }
                )
            }
            if (bookmark.children) {
                recursion_bookmark(bookmark.children);
            }
        }
    }

    recursion_bookmark(bookmarks);
    return result;
}

const getTabs = async () => {
    const tabs = await chrome.tabs.query({});

    var result = [];

    tabs.forEach(data => {
        if (validURL(data.favIconUrl)) {
            result.push({
                uuid: getUUID(),
                type: "tab",
                title: data.title,
                // title_pinyin: py(data.title),
                url: data.url,
                desc: "Chrome 标签",
                emoji: false,
                icon: data.favIconUrl,
                tab_id: data.id,
                tab_index: data.index,
                tab_windowId: data.windowId,
                keycheck: false,
                tags: ""
            })
        } else {
            result.push({
                uuid: getUUID(),
                type: "tab",
                title: data.title,
                // title_pinyin: py(data.title),
                url: data.url,
                desc: "Chrome 标签",
                emoji: true,
                emojiChar: "🚀",
                tab_id: data.id,
                tab_index: data.index,
                tab_windowId: data.windowId,
                keycheck: false,
                tags: ""
            })
        }
    });

    return result;
}

