async function getData() {
    var book_list = await getBookmarks()
    var tabs_list = await getTabs()
    var historys_list = await getHistorys()
    var top_list = await getTopSites()
    var setting_list = await getSettings()
    var so_list = await getSo()
    var action_list = await getActions()
    var web_list = await getWebs()

    var all_result_list = [
        ...setting_list,
        ...tabs_list,
        ...book_list,
        ...historys_list,
        ...top_list,
        ...action_list,
        ...web_list
    ]

    var all_result_dict = {
        "settings": setting_list,
        "tabs": tabs_list,
        "book": book_list,
        "historys": historys_list,
        "top": top_list,
        "so": so_list,
        "action": action_list,
        "web": web_list
    }

    return { "list": all_result_list, "dict": all_result_dict }
}

export { getData }